import MyPosts from './MyPosts/MyPosts';
import './Profile.css';
import ProfileInfo from './ProfileInfo/ProfileInfo';

function Profile() {
	return (
		<div>
			<ProfileInfo />
			<div>
				<img src="https://hatrabbits.com/wp-content/uploads/2017/01/random.jpg">
				</img>
			</div>
			<div>
				ava + discription
			</div>
			<MyPosts />
		</div >
	)
};

export default Profile;
